import Navi from "./layouts/Navi";
import { Container } from 'semantic-ui-react';
import { BrowserRouter, Link, Router } from "react-router-dom";


function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <Navi />
        <Container className="main">
          <Dashboard />
        </Container>
      </div>
    </BrowserRouter>


  );
}

export default App;
